import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { PetResponseModel } from '../models/response.models';
import { PetService } from '../services/pet.services';

@Component({
  selector: 'app-pet-list',
  templateUrl: './pet-list.component.html',
  styleUrls: ['./pet-list.component.css']
})
export class PetListComponent implements OnInit {
  pets: PetResponseModel[] = [];
  filteredPets: PetResponseModel[] = [];
  searchTerm: string = '';

  constructor(private router: Router, private petService: PetService) {}

  ngOnInit(): void {
    this.fetchPets();
  }

  fetchPets(): void {
    this.petService.getAllPets().subscribe(pets => {
      this.pets = pets;
      this.filteredPets = [...this.pets];
    });
  }

  filterPets(): void {
    const search = this.searchTerm.toLowerCase();
    this.filteredPets = this.pets.filter(pet =>
      pet.name.toLowerCase().includes(search) ||
      pet.petType.name.toLowerCase().includes(search) || 
      pet.petBreed.name.toLowerCase().includes(search) || 
      pet.petOwner.name.toLowerCase().includes(search)
    );
  }

  clearSearch(): void {
    this.searchTerm = '';
    this.filterPets();
  }

  goToNewPet(): void {
    this.router.navigate(['/pets/new']);
  }

  editPet(id: number): void {
    this.router.navigate([`/pets/${id}/edit`]);
  }

  deletePet(id: number): void {
    if (confirm('Are you sure you want to delete this pet?')) {
      this.petService.deletePet(id).subscribe(() => {
        console.log(`Deleted pet with ID ${id}`);
        this.fetchPets();
      }, error => {
        console.error('Error deleting pet:', error);
      });
    }
  }
}
<div class="container">
  <div class="row mb-3">
    <div class="col-md-6">
      <h2>Pets List</h2>
    </div>
  </div>

  <!-- Filter Section -->
  <div class="row mb-3 align-items-center">
    <div class="col-md-6">
      <input type="text" class="form-control" placeholder="Search pets..." [(ngModel)]="searchTerm" (ngModelChange)="filterPets()">
    </div>
    <div class="col-md-6 text-right">
      <button class="btn btn-primary mr-2" (click)="goToNewPet()">New Pet</button>
      <a routerLink="/appointments" class="btn btn-secondary">Back to Appointment</a>
    </div>
  </div>

  <!-- Pets Table -->
  <div class="table-responsive">
    <table class="table table-bordered">
      <thead>
        <tr>
          <th>Name</th>
          <th>Type</th>
          <th>Breed</th>
          <th>Owner</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        <tr *ngFor="let pet of filteredPets">
          <td>{{ pet.name }}</td>
          <td>{{ pet.petType.name }}</td>
          <td>{{ pet.petBreed.name }}</td>
          <td>{{ pet.petOwner.name }}</td>
          <td>
            <div class="btn-group" role="group" aria-label="Pet Actions">
              <button class="btn btn-sm btn-primary" (click)="editPet(pet.id)">Edit</button>
              <button class="btn btn-sm btn-danger ml-2" (click)="deletePet(pet.id)">Delete</button>
            </div>
          </td>
        </tr>
        <tr *ngIf="filteredPets.length === 0">
          <td colspan="5" class="text-center">No pets found.</td>
        </tr>
      </tbody>
    </table>
  </div>
</div>
